import React from "react";

// COMPONENTS
// import ClimaEspecifico from "screens/clima/ClimaEspecifico";
import Icono from "components/Icono/Icono";

function Clima() {

	function ClimaEspecifico() {
		return (
			<div className="clima">
				<h3>GG WP</h3>
			</div>
		)
	};

	return (
		<section id="clima">
			<h2>
				<Icono nombre="flood" />
				Clima
			</h2>
			<ClimaEspecifico />
		</section>
	)
}

export default Clima;
